import React from 'react';
import ReactDOM from 'react-dom';
import SideBar from './sidebar.js';
import Main from './main.js';

const App = () => (
    <div className='app'>
        <SideBar />
        <Main />
    </div>
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
